import React, { Component } from "react";
import axios from "axios";

export default class DisplayOrders extends Component {
  constructor(props) {
    super(props);
    this.state = {
      listData1: [],
    };
  }
  componentDidMount() {
    console.log(this.props.location); // it is equal to yourData
    this.setState({ listData1: this.props.location.state });
  }

  render() {
    return (
      <div>
        <div style={{ textAlign: "center", fontWeight: "bold", fontSize: 18 }}>
          <label>Package Details</label>
        </div>
        <table style={{ width: "100%" }}>
          <tr>
            <th>Serial Number</th>
            <th>Sender Name</th>
            <th>Arraived date</th>
            <th>View details </th>
          </tr>
          {this.state.listData1 !== undefined && this.state.listData1.length > 0
            ? this.state.listData1.map((item, index) => (
                <tr>
                  <td>{index}</td>
                  <td>{item.sender}</td>
                  <td>{moment(item.last_updated).format("MM/DD/YYYY")}</td>
                  <td>
                    <button onClick={() => this.getDetails(item)}>
                      {" "}
                      View Details
                    </button>
                  </td>
                </tr>
              ))
            : []}
        </table>
      </div>
    );
  }
}
